    private static async Task SeedRoles(IServiceProvider services)
    {
        var roleManager = services.GetRequiredService<RoleManager<Role>>();

        if (!await roleManager.RoleExistsAsync("Admin"))
            await roleManager.CreateAsync(new Role
            {
                UserTypeEnum = UserTypeEnum.Admin,
                Name = "Admin"
            });
        if (!await roleManager.RoleExistsAsync("Institution"))
            await roleManager.CreateAsync(new Role
            {
                UserTypeEnum = UserTypeEnum.Institution,
                Name = "Institution"
            });
        if (!await roleManager.RoleExistsAsync("Student"))
            await roleManager.CreateAsync(new Role
            {
                UserTypeEnum = UserTypeEnum.Student,
                Name = "Student"
            });
        if (!await roleManager.RoleExistsAsync("Company"))
            await roleManager.CreateAsync(new Role
            {
                UserTypeEnum = UserTypeEnum.Company,
                Name = "Company"
            });
    }
